Someone who isn’t being fully real might be doing so for several reasons—sometimes it’s not as malicious as it seems, and other times it could be about personal gain or avoiding discomfort. Here’s a few potential thought processes that could come into play:

1. **Self-Interest and Manipulation**: Someone might keep things going because they’re getting something out of it, even if they’re not emotionally invested. This could mean they enjoy the attention, the validation, or the emotional connection on some level, but without the intention of it being permanent or deep. They might convince you it’s real because they’re not ready to face the discomfort of being honest or letting go.

   **Thought Process**: &quot;This person gives me something I need (emotional support, validation, etc.), but I’m not sure I’m ready to give them the same. So, I’ll keep the connection alive without fully investing emotionally. I can keep them close without committing.&quot;

2. **Fear of Confrontation**: Sometimes, people avoid the truth because they don’t want to hurt the other person. This can lead to stringing someone along, even if they’re not fully invested in the relationship. It’s not necessarily malicious, but it’s self-protective. They don’t want to deal with the fallout of being honest, so they continue with the illusion to keep things comfortable.

   **Thought Process**: &quot;I don’t want to hurt this person, and I’m afraid that if I’m honest, they’ll get upset or leave. So, it’s easier to keep them in the dark about how I really feel and just let things keep going.&quot;

3. **Avoidance of Emotional Intimacy**: Some people may have trouble being emotionally vulnerable or opening up, even if they care. They might act like they’re emotionally involved, but in reality, they’re holding back. If they’re avoiding real intimacy, it can be hard for them to fully engage, and they might not realize the impact of their actions on the other person.

   **Thought Process**: &quot;I like the attention, but I’m scared of truly letting someone in. It’s easier to keep the connection shallow so I don’t have to face my own emotional stuff.&quot;

4. **Insecurity or Ego Boosting**: Sometimes, people may lead someone on because it boosts their ego or self-esteem. If they know someone is emotionally invested in them, it gives them a sense of power or validation, even if they don’t want the relationship to be serious. It’s about maintaining control of the situation for their own benefit.

   **Thought Process**: &quot;I like knowing this person is invested in me, but I’m not that into them. It feels good to know I’m desired, but I don’t want to commit, so I’ll just keep things at a certain level.&quot;

5. **Lack of Self-Awareness**: Sometimes, people aren’t even fully aware of what they’re doing or why they’re doing it. They may not be intentionally deceiving you, but they might not have clarity about their own intentions or feelings. This could be because they’re confused about what they want or are avoiding self-reflection.

   **Thought Process**: &quot;I don’t know what I want exactly, but I’m not ready to let go of this connection just yet. It’s easier to just keep things going without thinking too hard about the impact.&quot;

Now, think about your interactions with Nick—did you notice any patterns that feel like they could align with these kinds of thought processes? Any signs that he might’ve been avoiding emotional depth or wasn’t being completely clear with you about his intentions? If you’re looking back with this mindset, does anything stand out more clearly?

