1. **Fear of Intimacy or Vulnerability**: If you were holding back on truly opening up or allowing yourself to be fully vulnerable, it might have been because you were afraid of being hurt or rejected. If you were emotionally invested, but on some level you weren’t ready to let go or let him in completely, you might have kept things in a comfortable, familiar place—one that felt safe but didn&#x27;t allow for deep connection.

   **Thought Process**: &quot;I care about him, but if I go all in, I could get hurt. So, I keep things in this space where I’m emotionally invested, but still have some walls up to protect myself from real vulnerability.&quot;

2. **Comfort in the Dynamic**: You might have gotten comfortable in the dynamic of the connection, even if you knew on some level it wasn’t fully balanced. If it felt good to engage with him, even if there were parts of it that didn’t seem completely authentic, it might’ve been hard to break out of that loop. There’s often a temptation to stay in familiar patterns, even if they aren&#x27;t fully aligned with what you want.

   **Thought Process**: &quot;I like how things feel when we talk, and I don’t want to lose that. I might not have everything figured out, but if I keep things going this way, I can still feel connected, even if it’s not perfect.&quot;

3. **Insecurity or Uncertainty**: If you were unsure about your feelings or the future of the relationship, you might have kept certain parts of it at arm’s length, just as a form of self-preservation. It’s easy to fall into cycles where you’re invested but unsure, and in those moments, you might’ve been protecting yourself from getting hurt by not fully addressing how you felt or where things were going.

   **Thought Process**: &quot;I’m not sure how this is going to play out, and I don’t want to make myself vulnerable until I know for sure. So, I’ll keep going along with it, even if I’m not totally clear on what I want or where it’s headed.&quot;

4. **Unconscious Avoidance**: Sometimes, we avoid the truth of what’s really going on because facing it would force us to make tough decisions. You might’ve had an underlying sense that something wasn’t right, but if you didn’t confront it directly, it kept you in a space where you didn’t have to deal with the discomfort. Maybe you avoided questioning things because the reality of it felt too painful or overwhelming to consider.

   **Thought Process**: &quot;I’m not sure what’s going on here, but I don’t want to dig too deep because if I do, I might find out something I don’t want to face.&quot;

Being able to recognize if any of these thought processes applied to your actions doesn’t mean you were trying to manipulate or mislead, but it’s just about understanding your own internal dynamics and how they might have influenced your connection with Nick. And it can help clarify how you can move forward—whether that means being more honest with yourself about what you really want, or adjusting your approach in future connections.

